import React from "react";
import "../Styles/principal.css";
const Principal = () => {
  return (
    <>
      <div>Este es el contenido Principal el numero es</div>

      <img
         alt="img Logo react"
        href="www.facebook.com"
      ></img>
    </>
  );
};

export default Principal;
